import{_ as t}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as a}from"./chunks/rtl_cone.DihiHN2J.js";import{_ as i,c as r,a8 as o,o as n}from"./chunks/framework.BDnHobkS.js";const T=JSON.parse('{"title":"Return Mode (Multicopter)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_modes_mc/return.md","filePath":"ko/flight_modes_mc/return.md"}'),l={name:"ko/flight_modes_mc/return.md"};function d(h,e,s,c,m,u){return n(),r("div",null,e[0]||(e[0]=[o('<h1 id="return-mode-multicopter" tabindex="-1">Return Mode (Multicopter) <a class="header-anchor" href="#return-mode-multicopter" aria-label="Permalink to &quot;Return Mode (Multicopter)&quot;">​</a></h1><img src="'+t+'" title="Position fix required (e.g. GPS)" width="30px"><p>The <em>Return</em> flight mode is used to <em>fly a vehicle to safety</em> on an unobstructed path to a safe destination, where it can land.</p><p>Multicopters use a <a href="./../flight_modes/return.html#home-rally-point-return-type-rtl-type-0">home/rally point return type</a> by default. In this return type vehicles ascend to a safe altitude above obstructions if needed, fly directly to the closest safe landing point (a rally point or the home position), descend to the &quot;descent altitude&quot;, wait briefly, and then land. The return altitude, descent altitude, and landing delay are normally set to conservative &quot;safe&quot; values, but can be changed if needed.</p><p>Multicopter supports the <a href="./../flight_modes/return.html#return-types-rtl-type">other PX4 return types</a>, including mission landing, mission path and closest safe destination. The default type is recommended.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Mode is automatic - no user intervention is <em>required</em> to control the vehicle.</li><li>Mode requires a global 3d position estimate (from GPS or inferred from a <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">local position</a>). <ul><li>Flying vehicles can&#39;t switch to this mode without global position.</li><li>Flying vehicles will failsafe if they lose the position estimate.</li></ul></li><li>Mode requires home position is set.</li><li>Mode prevents arming (vehicle must be armed when switching to this mode).</li><li>RC 제어 스위치는 기체의 비행 모드를 변경할 수 있습니다.</li><li>RC stick movement will <a href="#COM_RC_OVERRIDE">by default</a> change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> unless handling a critical battery failsafe.</li></ul></div><h2 id="technical-summary" tabindex="-1">Technical Summary <a class="header-anchor" href="#technical-summary" aria-label="Permalink to &quot;Technical Summary&quot;">​</a></h2><p>Multicopters use the <a href="./../flight_modes/return.html#home-rally-point-return-type-rtl-type-0">home/rally point return type</a> by default. For this return type the copter:</p><ul><li>Ascends to the <a href="#minimum-return-altitude">minimum return altitude</a> (safely above any expected obstacles). The vehicle maintains its initial altitude if that is higher than the minimum return altitude.</li><li>Flies via a direct constant-altitude path to the safe landing point, which will be the nearest of any rally points and the home position.</li><li>On arrival at its destination, it rapidly descends to the &quot;descent altitude&quot; (<a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>).</li><li>It waits for a configurable time (<a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>), which may be used for deploying landing gear.</li><li>Then lands.</li></ul><h3 id="목적지에-호버링-착륙" tabindex="-1">목적지에 호버링/착륙 <a class="header-anchor" href="#목적지에-호버링-착륙" aria-label="Permalink to &quot;목적지에 호버링/착륙&quot;">​</a></h3><p>By default the <em>minimum return altitude</em> is set using <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a>, and the vehicle will just return at the higher of <code>RTL_RETURN_ALT</code> or the initial vehicle altitude.</p><p>The minimum return altitude can be further configured using <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a>, which together with <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> defines a half cone centered around the destination landing point. The cone angle allows a lower minimum return altitude when the return mode is executed close to the destination. This is useful when there are few obstacles near the destination, because it may reduce the minimum height that the vehicle needs to ascend before landing, and hence power consumption and time to land.</p><p><img src="'+a+'" alt="Return mode cone"></p><p>The cone affects the minimum return altitude if return mode is triggered within the cylinder defined by the maximum cone radius and <code>RTL_RETURN_ALT</code>: outside this cyclinder <code>RTL_RETURN_ALT</code> is used. Inside the code the minimum return altitude is the intersection of the vehicle position with the cone, or <code>RTL_DESCEND_ALT</code> (whichever is higher). In other words, the vehicle must always ascend to at least <code>RTL_DESCEND_ALT</code> if below that value.</p><p>For more information on this return type see <a href="./../flight_modes/return.html#home-rally-point-return-type-rtl-type-0">Home/Rally Point Return Type (RTL_TYPE=0)</a></p><h2 id="매개변수" tabindex="-1">매개변수 <a class="header-anchor" href="#매개변수" aria-label="Permalink to &quot;매개변수&quot;">​</a></h2><p>The RTL parameters are listed in <a href="./../advanced_config/parameter_reference.html#return-mode">Parameter Reference &gt; Return Mode</a>.</p><p>The parameters that are relevant to multicopter (assuming the <a href="./../advanced_config/parameter_reference.html#RTL_TYPE">RTL_TYPE</a> is set to 0) are listed below.</p><table tabindex="0"><thead><tr><th>매개변수</th><th>설명</th></tr></thead><tbody><tr><td><a id="RTL_RETURN_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_RETURN_ALT">RTL_RETURN_ALT</a></td><td>Return altitude in meters (default: 60m) when <a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a> is 0. 이미 이 값을 초과하면 기체는 현재 고도로 복귀합니다.</td></tr><tr><td><a id="RTL_DESCEND_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a></td><td>기체가 더 높은 복귀 고도에서 감속하거나 초기 하강을 중지할 최소 복귀 고도 및 고도 (기본값 : 30m)</td></tr><tr><td><a id="RTL_LAND_DELAY"></a><a href="./../advanced_config/parameter_reference.html#RTL_LAND_DELAY">RTL_LAND_DELAY</a></td><td>Time to hover at <code>RTL_DESCEND_ALT</code> before landing (default: 0.5s) -by default this period is short so that the vehicle will simply slow and then land immediately. If set to -1 the system will loiter at <code>RTL_DESCEND_ALT</code> rather than landing. 이 지연은 랜딩 기어가 배치될 시간을 설정합니다. (자동으로 동작함).</td></tr><tr><td><a id="RTL_MIN_DIST"></a><a href="./../advanced_config/parameter_reference.html#RTL_MIN_DIST">RTL_MIN_DIST</a></td><td>홈 위치에서 &quot;원뿔&quot;에 지정된 복귀 고도까지 상승을 시작하는 최소 수평 거리. If the vehicle is horizontally closer than this distance to home, it will return at its current altitude or <code>RTL_DESCEND_ALT</code> (whichever is higher) instead of first ascending to RTL_RETURN_ALT).</td></tr><tr><td><a id="RTL_CONE_ANG"></a><a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a></td><td>기체 RTL 리턴 고도를 정의하는 원뿔의 반각. 값 (도) : 0, 25, 45, 65, 80, 90. Note that 0 is &quot;no cone&quot; (always return at <code>RTL_RETURN_ALT</code> or higher), while 90 indicates that the vehicle must return at the current altitude or <code>RTL_DESCEND_ALT</code> (whichever is higher).</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Controls whether stick movement on a multicopter (or VTOL in MC mode) causes a mode change to <a href="./../flight_modes_mc/position.html">Position mode</a> (except when vehicle is handling a critical battery failsafe). 자동 모드와 오프보드 모드에 대해 별도로 활성화할 수 있으며, 기본적으로 자동 모드에서 활성화됩니다.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>The amount of stick movement that causes a transition to <a href="./../flight_modes_mc/position.html">Position mode</a> (if <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> is enabled).</td></tr></tbody></table><h2 id="see-also" tabindex="-1">See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;See Also&quot;">​</a></h2><ul><li><a href="./../flight_modes/return.html">Return Mode (Generic)</a></li><li><a href="./../flight_modes_fw/return.html">Return Mode (Fixed-Wing)</a></li><li><a href="./../flight_modes_vtol/return.html">Return Mode (VTOL)</a></li></ul>',21)]))}const R=i(l,[["render",d]]);export{T as __pageData,R as default};
